import { Component, effect, inject, input, signal, ViewChild, viewChild } from '@angular/core';
import { MatPaginator, MatPaginatorModule } from '@angular/material/paginator';
import { MatTableDataSource, MatTableModule } from '@angular/material/table';
import { MatIconModule } from '@angular/material/icon';
import { ComunicationService } from '../../services/comunication-service';
import { Persona } from '../../../../core/models/user-data';
import { MatDialog } from '@angular/material/dialog';
import { FormDialog } from '../../../../shared/components/dialogs/form-dialog/form-dialog';
import { DisableUserDialog } from '../../dialogs/disable-user-dialog/disable-user-dialog';
import { ConfirmationDialog } from '../../../../shared/components/dialogs/confirmation-dialog/confirmation-dialog';
import { EnableUserDialog } from '../../dialogs/enable-user-dialog/enable-user-dialog';
import { RegisterDataFormDialog } from '../../dialogs/register-data-form-dialog/register-data-form-dialog';
import { ModifDataFormDialog } from '../../dialogs/modif-data-form-dialog/modif-data-form-dialog';
import { ModifUserFormDialog } from '../../dialogs/modif-user-form-dialog/modif-user-form-dialog';
import { TableComponent } from "../../../../shared/components/table/table";

import pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { PdfView } from '../pdf-view/pdf-view';

(pdfMake as any).vfs = (pdfFonts as any).vfs;


@Component({
  selector: 'app-users-list-page',
  imports: [MatPaginatorModule, MatTableModule, MatIconModule, TableComponent],
  templateUrl: './users-list-page.html',
  styleUrl: './users-list-page.css'
})
export class UsersListPage {
  private comunication = inject(ComunicationService)
  paginator = viewChild(MatPaginator)
  dataSource = new MatTableDataSource<Persona>()
  displayedColumns: string[] = ['photo', 'name', 'state', 'actions']
  dialog = inject(MatDialog)

  usuarios = signal<Persona[]>([])

  query = input<string>("")

  columns=signal<any[]>([
    {
      columnDef: 'foto',
      header: 'Foto',
      cell: (p: Persona) => p.foto,
    },
    {
      columnDef: 'nombre',
      header: 'Nombre',
      cell: (p: Persona) => p.nombre + ' ' + p.ap + ' ' + p.am,
    },
    {
      columnDef: 'estado',
      header: 'Estado',
      cell: (p: Persona) => p.estado,
    },
    {
      columnDef: 'm',
      header: 'M',
      cell: (p: Persona) => "",
    },
    {
      columnDef: 'b',
      header: 'B',
      cell: (p: Persona) => "",
    },
    {
      columnDef: 'h',
      header: 'H',
      cell: (p: Persona) => "",
    },
    {
      columnDef: 'v',
      header: 'V',
      cell: (p: Persona) => "",
    },
    {
      columnDef: 'k',
      header: 'K',
      cell: (p: Persona) => p.user,
    },
  ]) 

  constructor() {
    effect(() => {
      this.obtenerPersonas()
      const usersList = this.comunication.users() || []
      this.dataSource.data = usersList
      const paginationInstance = this.paginator()
      if(paginationInstance) this.dataSource.paginator = paginationInstance
      if(this.dataSource.paginator) this.dataSource.paginator.firstPage()
    }, { allowSignalWrites: true })
  }

  obtenerPersonas(){
    this.usuarios.set(this.comunication.users()??[])
    console.log("usuarios",this.usuarios());
  }

  edit(p :any){
    this.comunication.selectedUser.set(p)
    this.dialog.open(FormDialog, {data: { content: ModifUserFormDialog }})
  }

  delete(p: any) {
    this.comunication.selectedUser.set(p)
    this.dialog.open(ConfirmationDialog, {data: { content: DisableUserDialog }})
  }

  enable(p: any) {
    this.comunication.selectedUser.set(p)
    this.dialog.open(ConfirmationDialog, {data: { content: EnableUserDialog }})
  }

  registerData(p: any) {
    this.comunication.selectedUser.set(p)
    this.dialog.open(FormDialog, {data: { content: RegisterDataFormDialog }})
  }

  editData(p: any) {
    this.comunication.selectedUser.set(p)
    this.dialog.open(FormDialog, {data: { content: ModifDataFormDialog }})
  }

  openPdf(p: any) {
    const today = new Date().toLocaleDateString('es-ES', { 
        year: 'numeric', month: 'long', day: 'numeric' 
    });
    const docDefinition: any = {
      pageMargins: [40, 40, 40, 40],
      //contenido del pdf  
      content: [
        {
          columns: [
            { 
              text: 'UNIDAD DE GESTIÓN DE USUARIOS', 
              style: 'logo' 
            },
            {
              text: 'INFORME DE PERFIL DE USUARIO', 
              style: 'title', 
              alignment: 'right' 
            }
          ],
        margin: [0, 0, 0, 20]
        },
        {
          columns: [
            { text: `Fecha de Emisión: ${today}`, style: 'metadata' },
            { text: p.estado === 1 ? 'Activo' : 'Inactivo', style: 'metadata', alignment: 'right' }
          ],
          margin: [0, 0, 0, 30],
          decoration: 'underline',
          decorationColor: '#003366'
        },
        {
          columns: [
            {
              width: '*',
              stack: [
                { text: 'DATOS PERSONALES', style: 'sectionHeader' },
                { 
                  columns: [
                    { text: 'Nombre Completo:', style: 'label', width: 120 },
                    { text: p.nombre + ' ' + p.ap + ' ' + p.am || 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { 
                  columns: [
                    { text: 'Cédula/ID:', style: 'label', width: 120 },
                    { text: p.datos.id.cedula || 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { 
                  columns: [
                    { text: 'Fecha de nacimiento:', style: 'label', width: 120 },
                    { text: p.fnac || 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { 
                  columns: [
                    { text: 'Estado Civil:', style: 'label', width: 120 },
                    { text: p.ecivil === 'D' ? 'Divorciado' : p.ecivil === 'C' ? 'Casado' : p.ecivil === 'S' ? 'Soltero' : 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { 
                  columns: [
                    { text: 'Genero:', style: 'label', width: 120 },
                    { text: p.genero === 'F' ? 'Femenino': p.genero === 'M' ? 'Masculino': 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { 
                  columns: [
                    { text: 'Tipo de usuario:', style: 'label', width: 120 },
                    { text: p.tipo === 'P' ? 'Publico': 'Administrativo', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                { text: '\nINFORMACIÓN DE CONTACTO', style: 'sectionHeader', margin: [0, 15, 0, 0] },
                { 
                  columns: [
                    { text: 'Teléfono:', style: 'label', width: 120 },
                    { text: p.telf || 'N/A', style: 'data' }
                  ], 
                  margin: [0, 8] 
                },
                {
                  columns: [
                    { text: 'Direccion', style: 'label', width: 120 },
                    { text: p.direc || 'N/A', stye: 'data' }
                  ],
                  margin: [0, 8]
                }
              ]
            },
            {
              width: 'auto',
              alignment: 'center',
              stack: [ 
                { 
                  image: `data:image/png;base64,`, 
                  width: 100
                }                          
              ]
            }
          ]
        }
      ],
      styles: {
        logo: {
          fontSize: 10,
          color: '#666666'
        },
        title: {
          fontSize: 18,
          bold: true,
          color: '#003366' // Azul oscuro
        },
        metadata: {
          fontSize: 9,
          color: '#333333'
        },
        sectionHeader: {
          fontSize: 14,
          bold: true,
          color: '#0055AA', // Azul primario
          margin: [0, 10, 0, 5]
        },
        label: {
          fontSize: 11,
          bold: true,
          color: '#333333'
        },
        data: {
          fontSize: 11,
          color: '#000000'
        },
        photoTitle: {
          fontSize: 10,
          bold: true,
          color: '#666666'
        }
      },
      footer: (currentPage: number, pageCount: number) => {
        return { 
          text: `Página ${currentPage.toString()} de ${pageCount}`, 
          alignment: 'center', 
          fontSize: 8,
          margin: [0, 20, 0, 0] 
        };
      }
    }

    pdfMake.createPdf(docDefinition).getBlob((blob: Blob) => {
      const url = URL.createObjectURL(blob)
      const urlO = `${url}#toolbar=0`
      this.dialog.open(PdfView, {
        width: '80%',
        data: { pdfUrl: urlO }
      })
    })
  }
}
